import React, { useState, useEffect } from "react";
import axios from "axios";
import RatingsList from "./RatingsList"; // Import the RatingsList component

function App() {
  const [ratings, setRatings] = useState([]);

  useEffect(() => {
    fetchRatings();
  }, []);

  function fetchRatings() {
    axios
      .get("http://localhost:4004/ratings")
      .then((res) => {
        setRatings(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }

  return (
    <div>
      <h1>Random Keyboard Sounds</h1>
      <RatingsList ratings={ratings} refreshRatings={fetchRatings} />
    </div>
  );
}

export default App;
